def hex_to_unicode(hex_string):
    # Convert hex string to bytes
    bytes_data = bytes.fromhex(hex_string)
    # Decode bytes to string using UTF-16 encoding
    return bytes_data.decode('utf-16-le')

# Example hex strings from the registry entries
hex_strings = [
    "10C012A107D9DA0148150000",  # This example seems short for decoding
    "",
    "",
    ""
]

for hex_string in hex_strings:
    print(hex_to_unicode(hex_string))
